import React, {Component} from 'react';
import {
  TouchableOpacity,
  View,
  Image,
  Text,
  StyleSheet,
  Dimensions,
  Alert,
  // ImageBackground,
} from 'react-native';

export default class Footer extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <View
        style={{
          width: '100%',
          // alignSelf: 'center',
          backgroundColor: '#000',
          // padding: 20,
          flexDirection: 'row',
          // backgroundColor: 'transparent',

          // justifyContent: 'space-between',
        }}>
        <View
          style={{
            flexDirection: 'row',
            alignItems: 'center',
            justifyContent: 'space-around',
            width: '35%',
          }}>
          <TouchableOpacity
            onPress={() => this.props.nav.navigate('TrendsScreen')}>
            <Image
              source={require('../../assets/images/home.png')}
              style={{height: 20, width: 25, alignSelf: 'center'}}
              resizeMode="contain"
            />
          </TouchableOpacity>
          <TouchableOpacity
            onPress={() => this.props.nav.navigate('MapScreen')}>
            <Image
              source={require('../../assets/images/map.png')}
              style={{height: 20, width: 25, alignSelf: 'center'}}
              resizeMode="contain"
            />
          </TouchableOpacity>
        </View>

        <View
          style={{
            width: '30%',
            alignItems: 'center',
          }}>
          <TouchableOpacity
            onPress={() => this.props.nav.navigate('AddTrendScreen')}>
            <Image
              source={require('../../assets/images/Webp.net-resizeimage.png')}
              resizeMode="contain"
              style={{height: 50, width: 70, backgroundColor: 'transparent'}}
            />
          </TouchableOpacity>
        </View>

        <View
          style={{
            flexDirection: 'row',
            alignItems: 'center',
            justifyContent: 'space-around',
            width: '35%',
          }}>
          <TouchableOpacity onPress={() => this.props.nav.navigate('Chat')}>
            <Image
              source={require('../../assets/images/chatIcon.png')}
              style={{height: 20, width: 25, alignSelf: 'center'}}
              resizeMode="contain"
            />
          </TouchableOpacity>
          <TouchableOpacity
            onPress={() => this.props.nav.navigate('MyProfileScreen')}>
            <Image
              source={require('../../assets/images/profile.png')}
              style={{height: 20, width: 25, alignSelf: 'center'}}
              resizeMode="contain"
            />
          </TouchableOpacity>
        </View>
      </View>
    );
  }
}
